s":{"ohlc_range":{"id":"1005"},"source":{"id":"1035"},"volume_range":{"id":"1045"}},"code":"if (!window._bt_scale_range) {\n    window._bt_scale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1136","type":"CustomJS"},{"attributes":{"data":{"Close":{"__ndarray__":"hPnaXGyhtD9Y9HM2/Xa0P3T+NblEibQ/fA1TmGSDtD8YpIEZOou0PwyfIFgWgrQ/hBxwd4R9tD/gdiQXj3u0P7BOKNYHdbQ/QOD1lblztD84xxyZnYi0PwSQA3n2h7Q/aMyDvwyztD9IzH1awZG0P/iKorfSfrQ/+Iqit9J+tD909HmbSJi0PySznvhZhbQ/7HuF2LKEtD8ks574WYW0P4QmLJWAbrQ/UNuaOeGLtD98DVOYZIO0P7REbLgLhLQ/hPnaXGyhtD/0Zw2duqK0PxSLqBweoLQ/OKSHfoWstD9g1j/dCKS0P5wNWf2vpLQ/IJAJ3kGptD8gmsX7PZq0P0CzpF2lprQ/7E40oJ63tD9g1j/dCKS0P9REch1XpbQ/MJVqn2WytD+Yxy7If+y0P6TMj4mj9bQ/2LPCVh5NtT/87zbTnTW1Pwj/U7K9L7U/NCdQ80Q2tT8g5oAa7WW1P0wYOXlwXbU/JAkWNQVCtT9AE9i3TFS1P4hoK5YzSbU/yLgds/Y0tT/8+fLwmSa1P4ifOOxDB7U/6P5NTXIOtT9si7pLAAS1PzhK5Q1dErU/lKS
